def generate_html_template(game_paths):
    template = "<ul>\n"
    for path in game_paths:
        game_name = path.split('/')[-2].replace('-', ' ').title()
        template += f"    <li><a href=\"{path}\"><img src=\"/path/to/empty/image.jpg\" alt=\"{game_name} Image\"> {game_name}</a></li>\n"
    template += "</ul>"
    return template

